return items.map(item => {
  const payload = item.json.body.data;
  const answers = payload.data;
  const metrics = payload.ttc;

  // --- CONFIGURACIÓN DE ZONA HORARIA Y FECHAS ---
  const timeZone = 'America/Monterrey';
  const startObj = new Date(payload.createdAt); // Fecha de creación (Inicio)
  const endObj = new Date(payload.updatedAt);   // Fecha de actualización (Fin)

  // 1. Fecha (YYYY-MM-DD)
  const submission_date = startObj.toLocaleDateString('en-CA', { timeZone });

  // 2. Hora Inicio (HH:mm:ss)
  const start_time = startObj.toLocaleTimeString('en-GB', { 
    timeZone, 
    hour12: false 
  });

  // 3. Hora Fin (HH:mm:ss)
  const end_time = endObj.toLocaleTimeString('en-GB', { 
    timeZone, 
    hour12: false 
  });

  // --- CÁLCULO DE DURACIÓN ---
  const total_ms = metrics._total || 0;
  const total_seconds = Math.floor(total_ms / 1000);
  const minutes = Math.floor(total_seconds / 60);
  const seconds = total_seconds % 60;
  const time_taken = `${minutes} min ${seconds} seg`;

  // --- CONSTRUCCIÓN DEL OBJETO FINAL ---
  // Definimos el orden exacto de los encabezados principales
