    employee_number: answers.employee_number.trim(),
    submission_date: submission_date,
    start_time: start_time,
    end_time: end_time,
    time_taken: time_taken
  };

  // --- AGREGAR PREGUNTAS DINÁMICAMENTE ---
  // Excluimos campos que ya usamos o que no sirven
