return items.map(item => {
  const user_data = item.json;

  let total_score = 0;
  let max_possible_score = 0;

  // Array para guardar el detalle pregunta por pregunta
  const results_breakdown = [];

  // Objeto para guardar puntaje por categoría (Ej: Seguridad: 10/10)
  const category_stats = {};

  // 3. COMPARACIÓN CON LA MASTER KEY
  questions_db.forEach(q => {
    // Obtenemos la respuesta del usuario usando el ID (ej: user_data.mach_1)
    const user_answer = user_data[q.id];

    // Verificamos si es correcta (comparación exacta de texto)
    const is_correct = user_answer === q.correct_answer;

    // Asignamos puntos
    const points_earned = is_correct ? q.score : 0;

    // Acumuladores globales
    total_score += points_earned;
    max_possible_score += q.score;

    // Lógica por Categoría
    if (!category_stats[q.category]) {
      category_stats[q.category] = { earned: 0, total: 0 };
    }
    category_stats[q.category].total += q.score;
    category_stats[q.category].earned += points_earned;

    // Agregamos al detalle
    results_breakdown.push({
      question_id: q.id,
      category: q.category,
      question_text: q.question,
      user_response: user_answer || "No respondido", // Manejo de respuestas vacías
      correct_response: q.correct_answer,
      status: is_correct ? 'CORRECTO' : 'INCORRECTO',
      points: points_earned,
      max_points: q.score
    });
  });

  // 4. CÁLCULO DE CALIFICACIÓN FINAL
  // Evitar división por cero
  const grade_percentage = max_possible_score > 0 
    ? (total_score / max_possible_score) * 100 
    : 0;

  // 5. RETORNO DE DATOS ORGANIZADOS
  return {
    json: {
      // Datos del Empleado (Heredados)
      employee_number: user_data.employee_number,
      submission_date: user_data.submission_date,
      time_taken: user_data.time_taken,

      // Resultados Generales
      final_score: total_score,
      max_possible_score: max_possible_score,
      grade_percentage: parseFloat(grade_percentage.toFixed(2)), // Redondear a 2 decimales
      passed: grade_percentage >= 80, // Ejemplo: Aprobado si > 80%

      // Desglose por Categoría
      category_performance: category_stats,

      // Detalle Pregunta por Pregunta (útil para guardar en otra hoja o BD)
      detailed_results: results_breakdown
    }
  };
});

